import React,{useState,useEffect} from 'react';
// import { Nav, NavItem, NavLink } from 'reactstrap';
import { Link } from 'react-router-dom';
import axios from 'axios'
import User from './components/User'
function Dashboard(props) {
    const [user, setUser] = useState([]);
    useEffect(() => {
        async function fetchMyAPI()
        {
            await axios.get('http://localhost:8080/users/'+props.match.params.id)
            .then((users)=>
            {
                user=setUser(users.data);
            })
            .catch((err)=>console.log("oh"+err))
        }
        fetchMyAPI();
    }, [])
    console.log(user);
  return (
    <div>
        {!user && <p>Loading</p>}
      {user.length>0 && <div><p>Welcome {user[0].name}</p><h1>{user[0].roll}</h1></div>}
      {user.length && <User users={user}/>}
      <nav>
        <ul className="nav-links">
            <Link to="/homepage">
                <li>Home</li>
            </Link>
            <Link to="/loginpage">
                <li>Login</li>
            </Link>
            <Link to="/signuppage">
                <li>Sign Up </li>
            </Link>
            <Link to="/passwordChange">
                <li>passwordChange</li>
            </Link>
            <Link to="/ProfileUpdate">
                <li>Profile Update</li>
            </Link>
            <Link to="/About">
                <li>About</li>
            </Link>
            <Link to="/Logout">
                <li>Logout</li>
            </Link>
            <br/>
        </ul>
    </nav>
    </div>
  );
}

export default Dashboard;
